import React, { Component } from "react";
import { Route,Switch} from "react-router-dom";
import Header from "../HomePage/Header.js"
import Body from "../HomePage/Header.js"
import ShrimpOrder from "../HomePage/ShrimpOrder"
import ShrimpSelling from "../HomePage/ShrimpSelling"

class RouterURL extends Component{
    render(){
        return(
            <div>
                <Switch>
                 <Route exact path="/" component={App}/>
                 <Route exact path="/thi-truong/mua-tom" component={ShrimpOrder}/>
                 <Route exact path="/thi-truong/ban-tom" component={ShrimpOrder}/>
                 <Route exact path="/" component={HomePage}/>
                </Switch>
             </div>

              );
      }

}
export default RouterURL;
